import React, {useState, useEffect } from 'react';

import 'styles/page/model.css'

function Model718(){
    const [feed, setFeeds] = useState([]);
    
    useEffect(() => {
        fetch("https://baby-1306b.web.app/model/model718.json")
        .then((res) => res.json())
        .then((data) => setFeeds(data));
    }, [])
    console.log(feed)
    
    return(
        <section className='container'>
            <div className='box_wrap'>
                <h1 className='hide'>Model</h1>
                <ul className='model_nav'>
                    <li className='btn'>718</li>
                    <li className='btn'>911</li>
                    <li className='btn'>Taycan</li>
                    <li className='btn'>Panamera</li>
                    <li className='btn'>Macan</li>
                    <li className='btn'>Cayenne</li>
                </ul>
                <div>
                    {feed.map((item) => (
                        <div className='model_info'>
                            <div>
                                <img src={item.url} />
                                <p>{item.model}</p>
                                <p>{item.price}</p>
                            </div>
                        </div>
                    ))}
                </div>
            </div>
        </section>
    )
}

export default Model718;
